  false,\n\t\"url\": null,\n\t\"notes\": \"During the spring and early summer of 1994
  most of Long Island, part of the Mark Twain NWR, was walked, and six east/west transects
  established. During July each forest type long each transect was studied using 1/2
  ha plots placed perpendicular to the transects. These plots (50 m X 100 m) were
  divided into quadrats 25 m on a side for ease in surveying. The number, size and
  species of all living and dead-standing stems (10 cm dbh and above) were recorded
  for each of the eight quadrats. The relative dominance, relative density, and importance
  value (IV) Here then recorded for each species in each study area. The average diameter
  (cm), density (#/ha) and basal area (m2 /ha) were also calculated for each species.
  The data from study areas with similar structure and species composition were then
  combined, and five relatively distinct forest community types were determined to
  be present on the island.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
